import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Assignment2';

  ratings = [
    {
      name: 'Todd Aaron',
      content: 'Todd Aaron: content text',
      rate: 4,
    },
    {
      name: 'Jesse Bing',
      content: 'Jesse Bing: content text',
      rate: 1,
    },
    {
      name: 'Tori Mitchell',
      content: 'Tori Mitchell: content text',
      rate: 2,
    },
    {
      name: 'John Nelson',
      content: 'John Nelson: content text',
      rate: 4,
    },
  ];
}
<body>
  <app-rating></app-rating>
  <app-rating [array]="ratings"></app-rating>
</body>
